import { useState } from "react";
import { useEffect } from "react";
import { useCookies } from 'react-cookie';

const SellsPending = e => {
    const [transactionFind, setTransactionFind] = useState([]);
    const [product, setProduct] = useState([]);
    const [cookies, setCookies] = useCookies(['user']);
    useEffect(() => {
        if(cookies.user 
            && cookies.user.rol !== 'seller'){
            Router.push('/')
        }else if(!cookies.user){
            Router.push('/')
        }
        const handlerFetch = async () => {
            const getFetch = await fetch('http://localhost:4000/v1/product/transaction/sells', {
                headers: {
                    'Content-Type': 'application/json',
                    'Access-Control-Allow-Origin': '*'
                }
            });
            const resFetch = await getFetch.json();
            setTransactionFind(resFetch);
        }
        const getAllProduct = async id => {
            const fetchAll = await fetch(`http://localhost:4000/v1/product/${id}`, {
                headers: {
                    'Content-Type': 'application/json',
                    'Access-Control-Allow-Origin': '*'
                }
            })
            const dataFetch = await fetchAll.json();
            setProduct(dataFetch);
        }
        handlerFetch();
        getAllProduct(transactionFind.id_product)
    }, [e])
    return(
        <>
        {
            transactionFind.status == 200 
            ? transactionFind.transaction.map((data, i) => (
                <article key={i} className='col-12 col-sm-12 col-lg-12 col-xl-12 col-sells'>
                    <ul>
                        <li>Cliente: <span className='text-dark'><strong>{data.id_client}</strong></span></li>
                        <li>Canal: <span className='text-primary'> <strong>{data.token_influencer}</strong></span></li>
                        <li>Precio: <span className='text-success'><strong>$23,000</strong></span></li>
                        <li>
                            <input type="button" value="Acreditado" className="btn btn-primary"/>
                            <input type="button" value="Rechazado" className="btn btn-warning"/>
                        </li>
                    </ul>
                    <ul>
                        <li>Título: {product.title}</li>
                        <li>Descripción: {product.description}</li>
                        <li>Localidad: {product.location}</li>
                        <li>Negocio: {product.business}</li>
                        <li>Categoría {product.type}</li>
                    </ul>
                </article>
            )) : <p>No hay transacciones disponibles</p> 
        }
        </>
    )
}

export default SellsPending;
